function getTodaysIndex(date)
{
	var d;
	if(date == undefined)
	{
		d = new Date();
		selectedPickerDate = d.toUTCString();
		currentDateSelected = d;
	}
	else
		d = date;
	
	var currMonth = d.getMonth() + 1; // since it is a 0 based index
	var currDate = d.getDate();
	var currYear = d.getFullYear();
	for(var i = 0; i < pDates.length; i++)
	{
		if( pDates[i].pDate == (currDate + "") 
			&&
			pDates[i].pMonth == (currMonth + "")
			&&
			pDates[i].pYear == (currYear + "")
			)
		{
			if(date == undefined)
				currentDateIndex = i;
			
			currentIndex = i;
			break;
		}	
	}
	if(date == undefined)
		fillTodaysValues();
	else
		fillSelectedDateValues();	
	
	getTodaysEvents();
}

function getTodaysEvents()
{
	var d = currentDateSelected;
	$.btnEvents.text = "Events on " + d.getDate() + " " + arrMonthNames[d.getMonth()] + ", " + d.getFullYear();
	todayEvents = [];
	
	var currMonth = d.getMonth() + 1; // since it is a 0 based index
	var currDate = d.getDate();
	var currYear = d.getFullYear();
	
	
	// check for aradhane
	for(var i = 0; i < objAradhana.length; i++)
	{
		var event = {};
	
		if( objAradhana[i].aDate == (currDate + "") 
			&&
			objAradhana[i].aMonth == (currMonth + "")
			&&
			objAradhana[i].aYear == (currYear + "")
			)
		{
			event.name = objAradhana[i].name;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = objAradhana[i].lat;
			event.lng = objAradhana[i].lng;
			event.type = "Aradhane";
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for ekadashi
	for(var j = 0; j < objEkadashi.length; j++)
	{
		var event = {};
		if( objEkadashi[j].eDate == (currDate + "") 
			&&
			objEkadashi[j].eMonth == (currMonth + "")
			&&
			objEkadashi[j].eYear == (currYear + "")
			)
		{
			event.name = objEkadashi[j].name;
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Ekadashi";
			
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for festival
	for(var k = 0; k < objFestival.length; k++)
	{
		var event = {};
		if( objFestival[k].fDate == (currDate + "") 
			&&
			objFestival[k].fMonth == (currMonth + "")
			&&
			objFestival[k].fYear == (currYear + "")
			)
		{
			event.name = objFestival[k].name;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Festival";
			
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for tarpana
	for(var l = 0; l < objTarpana.length; l++)
	{
		var event = {};
		if( objTarpana[l].tDate == (currDate + "") 
			&&
			objTarpana[l].tMonth == (currMonth + "")
			&&
			objTarpana[l].tYear == (currYear + "")
			)
		{
			event.name = objTarpana[l].desc;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Tarpana";
			
			todayEvents.push(event);
			break;			
		}	
	}
		
}

function fillSelectedDateValues()
{
	if(currentIndex != undefined)
	{
		fillValues(pDates[currentIndex]);
	}
		
	else
		displayAlert();
}

function fillTodaysValues()
{
	if(currentDateIndex != undefined)
	{
		fillValues(pDates[currentDateIndex]);
		currentIndex = currentDateIndex;
		selectedPickerDate = new Date();
		currentDateSelected = new Date();
		getTodaysEvents();
	}
		
	else
		displayAlert();
}

function displayAlert(message)
{
	var msg = message;
	if(message == undefined)
		msg = "Data not available";
		
	var dialog = Ti.UI.createAlertDialog({
		message : msg,
		buttonNames : ['OK'],
		title: "UM Panchanga"
	});
	
	dialog.show();
}

function nextDate()
{
	if(currentIndex != undefined)
	{
		if(currentIndex < pDates.length-1)
		{
			var selectedObject = pDates[currentIndex + 1];
			currentDateSelected = new Date(selectedObject.pYear, selectedObject.pMonth-1, selectedObject.pDate);
			fillValues(selectedObject);
			currentIndex++;
			getTodaysEvents();
		}		
		else
			displayAlert();	
	}
	else
		displayAlert();
}

function onPreviousDateClick()
{
	if(currentIndex != undefined)
	{
		if(currentIndex >= 1)
		{
			var selectedObject = pDates[currentIndex - 1];
			currentDateSelected = new Date(selectedObject.pYear, selectedObject.pMonth-1, selectedObject.pDate);
			fillValues(selectedObject);
			currentIndex--;
			getTodaysEvents();
		}		
		else
			displayAlert();
	}
	else
		displayAlert();	
}

function fillValues(selectedDate)
{
	var sunRiseMinutes = selectedDate.sunRiseMinute;
	var sunSetMinutes = selectedDate.sunsetMinute;
	if(currentDateIndex != undefined)
	{
		var shrahdaTxt = selectedDate.shradhaTithi;
		var delim = "-";
		var regex = new RegExp(delim, "g");		
		shrahdaTxt = selectedDate.shradhaTithi.replace(regex, ",");
		shrahdaTxt = shrahdaTxt.substring(0,shrahdaTxt.length-1);
		
		if(parseInt(sunRiseMinutes) < 10)
			sunRiseMinutes = "0" + selectedDate.sunRiseMinute;
		if(parseInt(sunSetMinutes) < 10)		
			sunSetMinutes = "0" + selectedDate.sunsetMinute;
		$.lblSunriseTime.text = selectedDate.sunRiseHour + ":" + sunRiseMinutes + " AM";
		$.lblSunsetTime.text = selectedDate.sunSetHour + ":" + sunSetMinutes + " PM";
		$.lblMasa.text = selectedDate.masa;
		$.lblNakshatra.text = selectedDate.nakshtra;
		$.lblDate.text = selectedDate.pDate + " " + arrMonthNames[selectedDate.pMonth-1] + " " + selectedDate.pYear + ", " + selectedDate.pDay;
		$.lblKarana.text = selectedDate.karnan;
		$.lblTithi.text = selectedDate.tithi + "(" + shrahdaTxt + ")";
		$.lblYoga.text = selectedDate.yoga;
		//$.lblShrdha.text = shrahdaTxt;
		$.lblAyan.text = selectedDate.ayan;
		$.lblRitu.text = selectedDate.ritu;
		$.lblPaksha.text = selectedDate.paksha;
	}
}

